import React, {Component} from 'react';
class Footer extends Component {
    render(){
        return(
            <div class="footer">
                <header>
                <h1>VietTraverller</h1>
                </header>
                <section className="section1">
                    <h2>Trang web preview du lịch Việt Nam</h2>
                    
                    Tông đài chăm sóc khách hàng:1900 1234
                    Văn phòng:16/3A,Thuận An,Bình Dương
                </section>
                <section className="section2">
                    <h2>Chính sách và quy định</h2>
                        <p>Điều khoản và điều kiện</p>
                        <p>Quy định về xác nhận thông tin</p>
                </section>
            </div>
            );
        }
}
export default Footer
